void test_00_0000()
{
    mmap.Reset();
    TEST_ASSERT(mmap.Initialize(MaxRomBankCount, MaxVramBankCount, MaxEramBankCount, MaxWramBankCount).IsSuccess());

    // Initial state
    {
        auto result = mmap.WriteWord(RegisterType::PC, 0x4DDF);
        TEST_ASSERT(result.IsSuccess());
    }
    {
        auto result = mmap.WriteWord(RegisterType::SP, 0xE82E);
        TEST_ASSERT(result.IsSuccess());
    }
    {
        auto result = mmap.WriteByte(RegisterType::A, 0x6E);
        TEST_ASSERT(result.IsSuccess());
    }
    {
        auto result = mmap.WriteByte(RegisterType::B, 0xB9);
        TEST_ASSERT(result.IsSuccess());
    }
    {
        auto result = mmap.WriteByte(RegisterType::C, 0x90);
        TEST_ASSERT(result.IsSuccess());
    }
    {
        auto result = mmap.WriteByte(RegisterType::D, 0xD0);
        TEST_ASSERT(result.IsSuccess());
    }
    {
        auto result = mmap.WriteByte(RegisterType::E, 0xBE);
        TEST_ASSERT(result.IsSuccess());
    }
    {
        TEST_ASSERT(static_cast<const Nibble>(mmap.WriteFlag(0xF0)) == 0x00);
    }
    {
        auto result = mmap.WriteByte(RegisterType::H, 0x83);
        TEST_ASSERT(result.IsSuccess());
    }
    {
        auto result = mmap.WriteByte(RegisterType::L, 0x93);
        TEST_ASSERT(result.IsSuccess());
    }
}
            

